import React from 'react'

const BrokerPopup = () => {
  return (
    <div className="popup center">
        <div className="icon">
            <i className="fa fa-check"></i>
        </div>
        <div class="title">Success !!</div>
        <div class="description"></div>
    </div>
  )
}

export default BrokerPopup;
